import osimport csvcsvpath = os.path.join('/Users/Clayton/Documents/JHU_Bootcamp/python-challenge/PyBank/Resources/budget_data.csv')#changes the type of the objects in the dictionary to string and integerdef customize(generator):    for row in generator:        row['Date'] = str(row['Date'])        row['Profit/Losses'] = int(row['Profit/Losses'])        yield row            with open(csvpath) as csvfile:    csvreader = customize(csv.DictReader(csvfile, delimiter=','))        #count number of rows, #of rows = number of months, as a function      def count_months():        print(sum(1 for row in csvreader))                # next(csvreader)      for row in csvreader:        total = sum(row[1])        print(total)    